package com.testwa.distest.server.entity;import com.testwa.core.base.annotation.TableName;import com.testwa.core.base.bo.BaseEntity;import lombok.Data;import lombok.ToString;@Data@ToString@TableName("device_use_logger")public class DeviceUseLogger extends BaseEntity {    private String deviceId;    private String userCode;    private boolean running;    private long startTime;    private long endTime;    public DeviceUseLogger(String deviceId) {        this.deviceId = deviceId;        this.running = true;        this.startTime = System.currentTimeMillis();    }}